def test_evaluation_speed():
    for position in random_positions:
        globals.white_pieces_bitboard = position['white_pawn'] | position['white_knight'] | position['white_bishop'] | position['white_rook'] | \
                            position['white_queen'] | position['white_king']
        globals.black_pieces_bitboard = position['black_pawn'] | position['black_knight'] | \
                            position['black_bishop'] | position['black_rook'] | position['black_queen'] | position['black_king']
        # hand-crafted evaluation
        start_time = time.time()
        evaluate_position(position, globals.white_pieces_bitboard, globals.black_pieces_bitboard, False, False, False, False, False, False, False, [])
        end_time = time.time()
        execution_time = end_time - start_time
        hand_crafted_evaluation_times.append(execution_time)
        # piece square table evaluation

        start_time = time.time()
        evaluate(position)
        end_time = time.time()
        execution_time = end_time - start_time
        piece_square_table_evaluation_times.append(execution_time)

def f8_alt(x):
    return "%14.9f" % x
pstats.f8 = f8_alt

def profile_code():
    pr = cProfile.Profile()
    pr.enable()
    test_evaluation_speed()
    print(f'hand crafted evaluation function times: {hand_crafted_evaluation_times}')
    print(f'piece square table evaluation function times: {piece_square_table_evaluation_times}')
    pr.disable()
    s = io.StringIO()
    sortby = 'cumulative'
    ps = pstats.Stats(pr, stream=s).sort_stats(sortby)
    ps.print_stats()
    print(s.getvalue())

if __name__ == '__main__':
    profile_code()